alls outside these guidelines, please contact us at least 5 working days before the registration deadline to discuss further.\n\nProjects must clearly show high-growth potential innovations in one or more of the following areas:\n\nany emerging technology that can demonstrate a step change in performance and the potential to disrupt existing industrial approaches\nwe are particularly looking to fund projects in energy harvesting, imaging technologies, graphene or biofilms\nany enabling technology in: satellite applications; electronics\nsensors; photonics; digital; internet of things; data; cybersecurity\nvirtual or augmented reality; and distributed ledger technology\nThe type of innovation project will depend on the challenges and opportunities your business faces.\n\nProposals must show how project success will improve business growth and productivity and/or encourage export opportunities, including for at least one UK small and medium-sized enterprise (SME) involved in the project.',NULL,0),(57,51,'How to apply','The lead applicant must register for an account using the link on this page. This will start the application process. During this process the lead applicant will be able to invite all other collaborators. Collaborators will be sent a link, which will help them to create an account and give them access to the application.',NULL,0),(58,54,'Background and further information','Technology is transforming our lives and brings great opportunity. The UK is strong in fundamental research across many different disciplines. However, we sometimes struggle to fully commercialise the opportunities. The most promising emerging technologies and industries need to be guided through the innovation process to market success.\n',NULL,0),(59,35,'Lead applicant eligibility','To lead a project, you must:\n\nbe a UK-based business (of any size)\nhave at least one SME involved in your proposal\ncarry out your project work, and intend to exploit the results, in the UK\nwork alone or in collaboration with others (businesses, research base and third sector)',NULL,0),(60,45,'Project scope','Our Emerging and Enabling Technologies programme (E&E) identifies and invests in new technologies and the underpinning capabilities that improve existing industries. Our aim is to inspire the new products, processes and services of tomorrow; those with the potential to unlock billions of pounds of value to industry and disrupt existing markets.\n\nAn emerging technology is one that is progressing in, or has recently emerged from, the research base. It allows us to do something that was not possible before. Because of this, it disrupts existing markets and enhances value to customers. It can improve our lives and lead to new sources of wealth generation.\n\nEnabling technologies underpin the development of high-value products and services in many industrial sectors and markets. They improve performance and productivity.\n\nThe aim of this competition is to help businesses broaden out innovation activities, to find new sources of revenue from new products, processes or services. Projects will:\n\nharness E&E technologies across the economy\ndevelop and scale-up research and development to bring ideas, processes and products closer to availability at scale and commercial release\nuse design processes to understand customer motivations and behaviour and use that insight to create better products, services and processes\nWe are looking to fund a portfolio of projects that include:\n\ntechnical feasibility\nindustrial research\nexperimental development\nwe will choose a portfolio that achieves a balance across topic areas, timing and costs\nIf your project falls outside these guidelines, please contact us at least 5 working days before the registration deadline to discuss further.\n\nProjects must clearly show high-growth potential innovations in one or more of the following areas:\n\nany emerging technology that can demonstrate a step change in performance and the potential to disrupt existing industrial approaches\nwe are particularly looking to fund projects in energy harvesting, imaging technologies, graphene or biofilms\nany enabling technology in: satellite applications; electronics\nsensors; photonics; digital; internet of things; data; cybersecurity\nvirtual or augmented reality; and distributed ledger technology\nThe type of innovation project will depend on the challenges and opportunities your business faces.\n\nProposals must show how project success will improve business growth and productivity and/or encourage export opportunities, including for at least one UK small and medium-sized enterprise (SME) involved in the project.',NULL,0),(61,83,'How to apply','The lead applicant must register for an account using the link on this page. This will start the application process. During this process the lead applicant will be able to invite all other collaborators. Collaborators will be sent a link, which will help them to create an account and give them access to the application.',NULL,0),(62,88,'Background and further information','Technology is transforming our lives and brings great opportunity. The UK is strong in fundamental research across many different disciplines. However, we sometimes struggle to fully commercialise the opportunities. The most promising emerging technologies and industries need to be guided through the innovation process to market success.\n',NULL,0);
