L),(1598,NULL,4,25,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,630,'APPLICATION','\0','PDF'),(1599,NULL,12,22,1,'Sub-contracting costs',NULL,NULL,0,643,'APPLICATION','',NULL),(1600,NULL,9,26,1,'Overheads',NULL,NULL,0,641,'APPLICATION','',NULL),(1601,NULL,8,14,1,'Labour',NULL,NULL,0,642,'APPLICATION','',NULL),(1602,NULL,26,20,0,'End of last financial year','Enter the date of your last financial year.','',3,606,'APPLICATION','',NULL),(1603,NULL,12,17,1,'Sub-contracting costs',NULL,NULL,0,622,'APPLICATION','',NULL),(1604,NULL,19,15,1,'Size',NULL,NULL,0,646,'APPLICATION','',NULL),(1605,NULL,6,10,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Workshop/laboratory usage charges:</strong> direct costs which relate to workshops or laboratories and which can be supported with actual usage data can be claimed. You should provide details of how the workshop/laboratory charge out rates per hour or day are calculated. This can include specific labour, rent, rates, maintenance, equipment, calibration costs, etc. These should form the overall costs together with the available operational hours to form the hourly or daily charge out rates.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for new IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,644,'APPLICATION','',NULL),(1606,NULL,20,18,1,'Upload a pdf copy of the Je-S output form once you have a status of \'With Council\'.',NULL,NULL,0,647,'APPLICATION','',NULL),(1607,NULL,24,25,0,'Turnover (£)','Your turnover from the last financial year.','',1,630,'APPLICATION','',NULL),(1608,NULL,6,9,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,650,'APPLICATION','',NULL),(1609,NULL,27,20,0,'Annual turnover','','',4,606,'APPLICATION','',NULL),(1610,NULL,6,27,1,NULL,'Overheads costs guidance','<p>If you wish to claim overheads, there are 2 options available to you:</p><p>Option 1: 20% overhead option. This allows you to claim 20% of your labour costs as overhead. No further documentation is needed.</p><p>Option2: Calculate overheads. This allows you to calculate direct and indirect overheads using our overhead spreadsheet. The overhead value claimed under this method will be subject to review if your application is successful. This is in order to assess the appropriateness of the overhead value you are claiming.</p>',0,648,'APPLICATION','',NULL),(1611,NULL,6,13,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,649,'APPLICATION','',NULL),(1612,NULL,6,21,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,645,'APPLICATION','',NULL),(1613,NULL,4,15,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,646,'APPLICATION','\0','PDF'),(1614,NULL,25,25,0,'Full time employees','Number of full time employees at your organisation.','',2,630,'APPLICATION','',NULL),(1615,NULL,6,12,1,NULL,NULL,NULL,0,653,'APPLICATION','',NULL),(1616,NULL,6,16,1,NULL,'Overheads costs guidance','<p>If you wish to claim overheads, there are 2 options available to you:</p><p>Option 1: 20% overhead option. This allows you to claim 20% of your labour costs as overhead. No further documentation is needed.</p><p>Option2: Calculate overheads. This allows you to calculate direct and indirect overheads using our overhead spreadsheet. The overhead value claimed under this method will be subject to review if your application is successful. This is in order to assess the appropriateness of the overhead value you are claiming.</p>',0,652,'APPLICATION','',NULL),(1617,NULL,24,15,0,'Turnover (£)','Your turnover from the last financial year.','',1,646,'APPLICATION','',NULL),(1618,NULL,27,20,0,'Annual profits','','',5,606,'APPLICATION','',NULL),(1619,NULL,14,10,1,'Other costs',NULL,NULL,0,654,'APPLICATION','',NULL),(1620,NULL,6,24,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,651,'APPLICATION','',NULL),(1621,NULL,6,26,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased spec