he project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,695,'APPLICATION','',NULL),(1678,NULL,27,10,0,'Annual turnover','','',4,669,'APPLICATION','\0',NULL),(1679,NULL,6,11,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,687,'APPLICATION','',NULL),(1680,NULL,9,18,1,'Overheads',NULL,NULL,0,699,'APPLICATION','',NULL),(1681,NULL,7,25,1,'Please enter the grant % you wish to claim for this project','What funding level should I enter?','<p>For a business or academic organisation, you can apply for any funding percentage between 0% and the maximum allowable for your organisation size. For other organisation types, you can apply for any funding percentage between 0% and 100%. The amount you apply for must reflect other funding you may have received. It must also be within participation levels which you can review on the Finances Overview page.</p>',0,698,'APPLICATION','',NULL),(1682,NULL,10,14,1,'Materials',NULL,NULL,0,692,'APPLICATION','',NULL),(1683,NULL,11,26,1,'Capital Usage',NULL,NULL,0,700,'APPLICATION','',NULL),(1684,NULL,12,24,1,'Sub-contracting costs',NULL,NULL,0,701,'APPLICATION','',NULL),(1685,NULL,14,22,1,'Other costs',NULL,NULL,0,703,'APPLICATION','',NULL),(1686,NULL,27,15,0,'Research and development spend','','',7,646,'APPLICATION','\0',NULL),(1687,NULL,11,9,1,'Capital Usage',NULL,NULL,0,694,'APPLICATION','',NULL),(1688,NULL,11,13,1,'Capital Usage',NULL,NULL,0,686,'APPLICAT