e up the experiment to a percentage of industrial scale to confirm.\n\n\n\nWe will take this data and engineer a solution to isolate the problem we will then collude with our fabrication partner to design and prototype a tool to correct the obstacle.\n\n',985,53,29,NULL),(658,'2018-02-22 19:53:21','This is the applicant response for what is the business opportunity that your project addresses?.',781,89,67,NULL),(659,NULL,NULL,NULL,NULL,NULL,NULL),(660,NULL,NULL,NULL,NULL,NULL,NULL),(661,'2018-02-22 19:53:21','This is the applicant response for what is the size of the potential market for your project?.',833,75,58,NULL),(662,NULL,NULL,NULL,NULL,NULL,NULL),(663,'2018-02-22 19:53:21',NULL,1121,60,20,52),(664,'2018-02-22 19:53:21','This is the applicant response for how does your project align with the scope of this competition?.',713,81,61,NULL),(665,'2018-02-22 19:53:21','This is the applicant response for what technical approach will you use and how will you manage your project?.',1047,36,13,NULL),(666,NULL,NULL,NULL,NULL,NULL,NULL),(667,NULL,NULL,NULL,NULL,NULL,NULL),(668,'2018-02-22 19:53:21','This is the applicant response for what technical approach will you use and how will you manage your project?.',1047,61,24,NULL),(669,NULL,NULL,NULL,NULL,NULL,NULL),(670,'2018-02-22 19:53:21','This is the applicant response for what is the business opportunity that your project addresses?.',686,54,25,NULL),(671,NULL,NULL,NULL,NULL,NULL,NULL),(672,'2018-02-22 19:53:21','This is the applicant response for how does your project align with the scope of this competition?.',713,79,53,NULL),(673,'2018-02-22 19:53:21','This is the applicant response for what will your project cost?.',1333,64,33,NULL),(674,NULL,NULL,NULL,NULL,NULL,NULL),(675,NULL,NULL,NULL,NULL,NULL,NULL),(676,'2018-02-22 19:53:21','This is the applicant response for what is the business opportunity that your project addresses?.',686,56,22,NULL),(677,'2018-02-22 19:53:21','This is the applicant response for what are the risks (technical, commercial and environmental) to your project\'s success? what is your risk management strategy?.',1243,58,32,NULL),(678,NULL,NULL,NULL,NULL,NULL,NULL),(679,NULL,NULL,NULL,NULL,NULL,NULL),(680,'2018-02-22 19:53:21',NULL,1062,61,24,54),(681,'2018-02-22 19:53:21',NULL,1062,36,13,53),(682,'2018-02-22 19:53:21','This is the applicant response for what economic, social and environmental benefits do you expect your project to deliver and when?.',975,68,48,NULL),(683,NULL,NULL,NULL,NULL,NULL,NULL),(684,'2018-02-22 19:53:21','Three principal risks exist at this stage:\n\n1.        The academic scale up fails to replicate the smaller results either entirely or not to a satisfactory level. In this event the academic partner would begin a controlled scale back to identify if the method needs to be altered during scale up to replicate results.  In the event that the issue can only be identified in the small scale we would build that into our planning for the isolation phase\n\n2.      During the phase to engineer a technique to isolate the issue we anticipate that there are inherent safety issues.  We have consulted an independent firm to ensure that suitable equipment and measures have been put in place to minimise the risk to staff.\n\n3.    Although we are confident that our fabrication partner is the best option for the prototype solution there is an indication that a particular piece of heavy machinery, currently unavailable in the UK will be required.  Our Fabrication partner has already investigated options for accessing this equipment in the Far East and an appropriate budget has been set aside to be used for this purpose if required.\n\n',1150,42,31,NULL),(685,NULL,NULL,NULL,NULL,NULL,NULL),(686,'2018-02-22 19:53:21','This is the applicant response for what is the size of the potential market for your project?.',833,78,51,NULL),(687,'2018-02-22 19:53:21','This is the applicant response for what are the risks (technical, commercial and environmental