,NULL),(2550,'2018-02-22 19:53:30','Wastage in our industry can be attributed in no small part to one issue.  To date businesses have been reluctant to tackle that problem and instead worked around it.  That has stifled progress.\n\n\n\nThe end result of our project will be a novel tool to manage the issue and substantially reduce the wastage caused by it.\n\n',637,149,112,NULL),(2551,'2018-02-22 19:53:30','This is the applicant response for what technical approach will you use and how will you manage your project?.',1047,131,96,NULL),(2552,NULL,NULL,NULL,NULL,NULL,NULL),(2553,NULL,NULL,NULL,NULL,NULL,NULL),(2554,'2018-02-22 19:53:30','This is the applicant response for what is innovative about your project?.',1103,142,107,NULL),(2555,'2018-02-22 19:53:30',NULL,1062,145,109,248),(2556,NULL,NULL,NULL,NULL,NULL,NULL),(2557,'2018-02-22 19:53:30',NULL,1062,131,96,249),(2558,'2018-02-22 19:53:30','This is the applicant response for what will your project cost?.',1329,128,92,NULL),(2559,'2018-02-22 19:53:30','This is the applicant response for what is the business opportunity that your project addresses?.',781,148,111,NULL),(2560,NULL,NULL,NULL,NULL,NULL,NULL),(2561,NULL,NULL,NULL,NULL,NULL,NULL),(2562,'2018-02-22 19:53:30','This is the applicant response for what technical approach will you use and how will you manage your project?.',1047,137,102,NULL),(2563,NULL,NULL,NULL,NULL,NULL,NULL),(2564,'2018-02-22 19:53:30','This is the applicant response for what economic, social and environmental benefits do you expect your project to deliver and when?.',975,144,106,NULL),(2565,NULL,NULL,NULL,NULL,NULL,NULL),(2566,'2018-02-22 19:53:30',NULL,1121,142,107,250),(2567,'2018-02-22 19:53:30','This is the applicant response for what will your project cost?.',1329,143,108,NULL),(2568,NULL,NULL,NULL,NULL,NULL,NULL),(2569,'2018-02-22 19:53:30','Wastage in our industry can be attributed in no small part to one issue.  To date businesses have been reluctant to tackle that problem and instead worked around it.  That has stifled progress.\n\n\n\nThe end result of our project will be a novel tool to manage the issue and substantially reduce the wastage caused by it.\n\n',637,38,17,NULL),(2570,'2018-02-22 19:53:30','This is the applicant response for what are the risks (technical, commercial and environmental) to your project\'s success? what is your risk management strategy?.',1183,140,104,NULL),(2571,NULL,NULL,NULL,NULL,NULL,NULL),(2572,NULL,NULL,NULL,NULL,NULL,NULL),(2573,'2018-02-22 19:53:30','This is the applicant response for how does financial support from innovate uk and its funding partners add value?.',1367,134,99,NULL),(2574,'2018-02-22 19:53:30',NULL,1062,137,102,251),(2575,NULL,NULL,NULL,NULL,NULL,NULL),(2576,'2018-02-22 19:53:30','This is the applicant response for what is innovative about your project?.',1103,131,96,NULL),(2577,NULL,NULL,NULL,NULL,NULL,NULL),(2578,'2018-02-22 19:53:30','This is the applicant response for what will your project cost?.',1329,135,97,NULL),(2579,NULL,NULL,NULL,NULL,NULL,NULL),(2580,'2018-02-22 19:53:30','Three principal risks exist at this stage:\n\n1.        The academic scale up fails to replicate the smaller results either entirely or not to a satisfactory level. In this event the academic partner would begin a controlled scale back to identify if the method needs to be altered during scale up to replicate results.  In the event that the issue can only be identified in the small scale we would build that into our planning for the isolation phase\n\n2.      During the phase to engineer a technique to isolate the issue we anticipate that there are inherent safety issues.  We have consulted an independent firm to ensure that suitable equipment and measures have been put in place to minimise the risk to staff.\n\n3.    Although we are confident that our fabrication partner is the best option for the prototype solution there is an indication that a particular piece of heavy machinery, currently unavailable in t