 investigator and his team have been studying the issue for a number of years and have qualifications across the spectrum that apply to the field.  Together they have already identified several efficiencies that can be made within the industry.\n\n\n\nThe Fabricators ? Are a leading team within complex engineering fabrication.  They have work on multiple high budget engineering solutions and consist of a team of people with many years? experience in a range of industries\n\n',1237,151,114,NULL),(2618,'2018-02-22 19:53:30','This is the applicant response for project summary.',645,154,117,NULL),(2619,NULL,NULL,NULL,NULL,NULL,NULL),(2620,'2018-02-22 19:53:30','This is the applicant response for does your project team have the skills, experience and facilities to deliver this project?.',1261,142,107,NULL),(2621,'2018-02-22 19:53:30',NULL,1121,137,102,255),(2622,NULL,NULL,NULL,NULL,NULL,NULL),(2623,NULL,NULL,NULL,NULL,NULL,NULL),(2624,'2018-02-22 19:53:30',NULL,1268,140,104,256),(2625,'2018-02-22 19:53:30',NULL,1268,131,96,257),(2626,'2018-02-22 19:53:30','Three principal risks exist at this stage:\n\n1.        The academic scale up fails to replicate the smaller results either entirely or not to a satisfactory level. In this event the academic partner would begin a controlled scale back to identify if the method needs to be altered during scale up to replicate results.  In the event that the issue can only be identified in the small scale we would build that into our planning for the isolation phase\n\n2.      During the phase to engineer a technique to isolate the issue we anticipate that there are inherent safety issues.  We have consulted an independent firm to ensure that suitable equipment and measures have been put in place to minimise the risk to staff.\n\n3.    Although we are confident that our fabrication partner is the best option for the prototype solution there is an indication that a particular piece of heavy machinery, currently unavailable in the UK will