of this project.\n\n\n\nUK Investment will ensure that we are able to retain the onward manufacture internally instead of needing to create international deals taking work and profit out of the country.\n\n',1404,150,113,NULL),(3033,NULL,NULL,NULL,NULL,NULL,NULL),(3034,'2018-02-22 19:53:46','The Project aims to identify, isolate and correct an issue that has hindered progress in this field for a number of years.\n\nIdentification will involve the university testing conditions to determine the exact circumstance of the Issue.\n\nOnce Identification has been assured we will work to Isolate the issue but replicating the circumstances in which it occurs within a laboratory environment.\n\nAfter this we will work with our prototyping partner to create a tool to correct the issue.  Once tested and certified this will be rolled out to mass production.\n\n',668,150,113,NULL),(3035,NULL,NULL,NULL,NULL,NULL,NULL),(3036,'2018-02-22 19:53:47','The planned end result of the project would be a fully implementable tool that could be rolled out to the industry.\n\n\n\n Once a fully tested prototype can be demonstrated we can start to take orders and travel to international Industry leaders the exhibit the value of the tool.\n\n',856,150,113,NULL),(3037,NULL,NULL,NULL,NULL,NULL,NULL),(3038,'2018-02-22 19:53:47','The Project aims to identify, isolate and correct an issue that has hindered progress in this field for a number of years.\n\nIdentification will involve the university testing conditions to determine the exact circumstance of the Issue.\n\nOnce Identification has been assured we will work to Isolate the issue but replicating the circumstances in which it occurs within a laboratory environment.\n\nAfter this we will work with our prototyping partner to create a tool to correct the issue.  Once tested and certified this will be rolled out to mass production.\n\n',624,150,113,NULL),(3039,NULL,NULL,NULL,NULL,NULL,NULL),(3040,'2018-02-22 19:53:47','Wastage in our industry can be attributed in no small part to one issue.  To date businesses have been reluctant to tackle that problem and instead worked around it.  That has stifled progress.\n\n\n\nThe end result of our project will be a novel tool to manage the issue and substantially reduce the wastage caused by it.\n\n',637,150,113,NULL),(3041,NULL,NULL,NULL,NULL,NULL,NULL),(3042,'2018-02-22 19:53:47','Three principal risks exist at this stage:\n\n1.        The academic scale up fails to replicate the smaller results either entirely or not to a satisfactory level. In this event the academic partner would begin a controlled scale back to identify if the method needs to be altered during scale up to replicate results.  In the event that the issue can only be identified in the small scale we would build that into our planning for the isolation phase\n\n2.      During the phase to engineer a technique to isolate the issue we anticipate that there are inherent safety issues.  We have consulted an independent firm to ensure that suitable equipment and measures have been put in place to minimise the risk to staff.\n\n3.    Although we are confident that our fabrication partner is the best option for the prototype solution there is an indication that a particular piece of heavy machinery, currently unavailable in the UK will be required.  Our Fabrication partner has already investigated options for accessing this equipment in the Far East and an appropriate budget has been set aside to be used for this purpose if required.\n\n',1150,150,113,NULL),(3043,NULL,NULL,NULL,NULL,NULL,NULL),(3044,'2018-02-22 19:53:47','The team consists of:\n\nUs - We have been supplying engineering solutions to the industry for a number of years and have been principal deliverers for various advancements within the field.  We are a suitably sized team capable of developing flexible solutions to a wide variety of clients internationally.\n\n\n\nAcademic ? the principal investigator and his team have been studying the issue for a number of years and have qualifications across the spectrum that apply to the field.  Together they have already identified several efficiencies that can be made within the industry.\n\n\n\nThe Fabricators ? Are a leading team within complex engineering fabrication.  They have work on multiple high budget engineering solutions and consist of a team of people with many years? experience in a range of industries\n\n',1300,162,124,NULL),(3045,NULL,NULL,NULL,NULL,NULL,NULL),(3046,'2018-02-22 19:53:47','The tool will give the consortium the leading edge on the technology as currently no one else is close to considering developing a solution.\n\n\n\nThe Industry will be able to reduce wastage by a significant degree and pass those savings on to the consumer or reinvest into advancing the field.\n\n\n\nInside 2 years it is estimated that a very large sum of money can be recouped by using our solution\n\n',938,150,113,NULL),(3047,NULL,NULL,NULL,NULL,NULL,NULL),(3048,'2018-02-22 19:53:47','Although steps are under way to get this project off the ground, investment by Innovate UK will stimulate Industry leads to supply additional resource funding and use of their facilities as required to advance the progress of this project.\n\n\n\nUK Investment will ensure that we are able to retain the onward manufacture internally instead of needing to create international deals taking work and profit out of the country.\n\n',1469,162,124,NULL),(3049,NULL,NULL,NULL,NULL,NULL,NULL),(3050,'2018-02-22 19:53:47','The project is based on Manchester?s novel IP that, for the first time, allows SLM to be conducted without any need for anchors/supports. A search of the literature has established that the advances proposed in this project on which RAMP are based are not available via any commercially available process. In addition, the development and supply of tailored materials by Empire and a dedicated high temperature rig by Ludlow will involve further, critical degrees of innovation th