INSERT INTO `public_content` VALUES (2,9,'2018-02-22 19:53:08','Innovate UK is investing up to £15 million in innovation projects to stimulate the new products and services of tomorrow','Up to £35,000','UK based business of any size. Must involve at least one SME','Innovate UK is investing up to £15 million in innovation projects to stimulate the new products and services of tomorrow.\nThe aim of this competition is to help businesses innovate to find new revenue sources. Proposals should show how to achieve a step change in business growth, productivity and export opportunities for at least one UK small and medium-sized enterprise (SME).\nWe expect projects to range from total costs of £35,000 to £2 million. Projects should last between 6 months and 3 years.\nThere are 2 options to apply into this competition, dependent on project size and length, these are referred to as streams. Stream 1 is for projects under 12 months duration and under £100,000. Stream 2 is for projects lasting longer than 12 months or costing over £100,000.','GRANT','£15 million','\0'),(3,10,'2018-02-22 19:53:12','Innovate UK is investing up to £15 million in innovation projects to stimulate the new products and services of tomorrow','Up to £35,000','UK based business of any size. Must involve at least one SME','Innovate UK is investing up to £15 million in innovation projects to stimulate the new products and services of tomorrow.\nThe aim of this competition is to help businesses innovate to find new revenue sources. Proposals should show how to achieve a step change in business growth, productivity and export opportunities for at least one UK small and medium-sized enterprise (SME).\nWe expect projects to range from total costs of £35,000 to £2 million. Projects should last between 6 months and 3 years.\nThere are 2 options to apply into this competition, dependent on project size and length, these are referred to as streams. Stream 1 is for projects under 12 months duration and under £100,