pplied for or received any other public sector funding for this project. Any other funding received will need to be deducted from the total value of any funding you are claiming for this project.</p>','\0','',NULL,NULL,1,NULL,6,79,NULL,'GENERAL'),(183,'','Please note that legal or project audit and accountancy fees are not eligible and should not be included as an \'other cost’. Patent filing costs of New IP relating to the project are limited to £7,500 for SME applicants only.  Please provide estimates of other costs that do not fit within any other cost headings.','','','Other costs','Other costs',2,NULL,6,79,NULL,'COST'),(184,'',NULL,'\0','\0','FINANCE_SUMMARY_INDICATOR_STRING',NULL,17,NULL,6,80,NULL,'GENERAL'),(185,'\0','<h2 class=\"heading-medium\">Funding rules for this competition</h2><p>We will fund projects between &pound;500,000 and &pound;1.5 million. We may consider projects with costs outside of this range. We expect projects to last between 12 and 36 months.</p><p>Innovate UK\'s aim is to optimise the level of funding businesses receive. We also recognise the importance of research organisations\' contribution to R&amp;D projects. Therefore we require the following levels of participation:</p><ul class=\"list-bullet\"> <li>at least 70% of the total eligible project costs are incurred by commercial organisations and</li> <li>a maximum of 30% of total eligible project costs are available to research participants. Where there is more than one research participant, this maximum will be shared between them.</li></ul>','\0','\0',NULL,NULL,16,NULL,6,80,NULL,'GENERAL'),(186,'\0','Enter the full title of the project','','\0','Application details','Application details',1,NULL,7,81,NULL,'GENERAL'),(187,'','Please provide a short summary of your project. Make sure you include what is innovative about it.','','\0','Project summary','Project summary',2,NULL,7,81,NULL,'GENERAL'),(188,'','Please provide a brief description of your project. If your application is successful, we will publish this description. This question is mandatory but we will not assess this content as part of your application.','','\0','Public description','Public description',3,NULL,7,81,NULL,'GENERAL'),(189,'','If your application doesn\'t align with the scope, we will reject it.','','\0','How does your project align with the scope of this competition?','Scope',4,NULL,7,81,NULL,'GENERAL'),(190,'',NULL,'','\0','What is the business opportunity that your project addresses?','Business opportunity',5,'1',7,82,10,'GENERAL'),(191,'',NULL,'','\0','What is the size of the potential market for your project?','Potential market',6,'2',7,82,10,'GENERAL'),(192,'',NULL,'','\0','How will you exploit and market your project?','Project exploitation',7,'3',7,82,10,'GENERAL'),(193,'',NULL,'','\0','What economic, social and environmental benefits do you expect your project to deliver and when?','Economic benefit',8,'4',7,82,10,'GENERAL'),(194,'','Describe the areas of work and your objectives. List all resource and management needs. Provide an overview of your technical approach.','','\0','What technical approach will you use and how will you manage your project?','Technical approach',9,'5',7,82,10,'GENERAL'),(195,'','Explain how your project is innovative in both a commercial and technical sense.','','\0','What is innovative about your project?','Innovation',10,'6',7,82,10,'GENERAL'),(196,'','We recognise that many of the projects we fund are risky. This is why we need to be sure that you have an adequate plan for managing this risk.','','\0','What are the risks (technical, commercial and environmental) to your project\'s success? What is your risk management strategy?','Risks',11,'7',2,82,10,'GENERAL'),(197,'','Describe your capability to develop and exploit this technology. Include details of your team\'s track record in managing research and development projects.','','\0','Does your project team have the skills, experience and facilities to deliver this project?','Project team',12,'8',2,82,10,'GENERAL'),(198,'','Tell us the total costs of the project and how much funding you need from Innovate UK. Please provide details of your expected project costs along with any supporting information. Please justify any large expenditure in your project.','','\0','What will your project cost?','Funding',13,'9',2,82,10,'GENERAL'),(199,'',' ','','\0','How does financial support from Innovate UK and its funding partners add value?','Adding value',14,'10',2,82,10,'GENERAL'),(200,'\0','Only your organisation can see this level of detail. All members of your organisation can access and edit your finances. We recommend assigning completion of your finances to one member of your team. <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\" rel=\"external\">Find out which project costs are eligible.</a> ','','','Provide the project costs for \'{organisationName}\'','Project finances',15,NULL,7,85,NULL,'GENERAL'),(201,'\0','To determine the level of funding you are eligible to receive please provide your business size using the <a href=\"http://ec.europa.eu/growth/smes/business-friendly-environment/sme-definition/index_en.htm\" target=\"_blank\" rel=\"external\">EU Definition</a> for guidance.','','','Size','Business size',18,NULL,7,86,NULL,'GENERAL'),(202,'\0','Please tell us if you have ever applied for or received any other public sector funding for this project. You should also include details of any offers of funding you\'ve received.','','','Other funding','Other funding',20,NULL,7,87,NULL,'COST'),(203,'\0','Please enter the funding level that you would like to apply for in this application','','','Funding level','Funding level',19,NULL,7,87,NULL,'GENERAL'),(204,'\0','<a target=\"_blank\" href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance/guidance-for-academics-applying-via-the-je-s-system\">How do I create my Je-S output?</a>','','','Upload a pdf copy of the Je-S output confirming a status of \'With Council\'','Je-s Output',20,NULL,7,85,NULL,'GENERAL'),(205,'','<p>You may claim the labour costs of all individuals you have working on your project.</p> <p> If your application is awarded funding, you will need to account for all your labour costs as they occur. For example, you should keep timesheets and payroll records. These should show the actual hours worked by individuals and paid by the organisation.</p>','\0','',NULL,NULL,1,NULL,7,88,NULL,'GENERAL'),(206,'',NULL,'','','Labour',NULL,2,NULL,7,88,NULL,'COST'),(207,'',NULL,'\0','',NULL,NULL,1,NULL,7,89,NULL,'GENERAL'),(208,'','<p>You may incur indirect support staff costs linked with your administrative work for the project. To be eligible, these costs should be directly attributable and incremental to the project. Indirect costs associated with commercial activities are not eligible and must not be included. For further information on which costs are eligible please read our <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs guidance</a>.</p>','','','Overheads','Indirect costs',2,NULL,7,89,NULL,'GENERAL'),(209,'','<p>You can claim the costs of materials used on your project providing:</p><ul class=\"list-bullet\"><li>they are not already purchased or included in the administration support costs</li><li>they are purchased from third parties</li><li>they won’t have a residual/resale value at the end of your project. If they do you can claim the costs minus this value</li></ul><p><a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\" rel=\"external\">Please refer to our guide to project costs for further information.</a></p>','\0','',NULL,NULL,1,NULL,7,90,NULL,'GENERAL'),(210,'','Please provide a breakdown of the materials you expect to use during the project','','','Materials','Materials',2,NULL,7,90,NULL,'COST'),(211,'','<p>You should provide details of capital equipment and tools you will buy for, or use on, your project.</p>','\0','',NULL,NULL,1,NULL,7,91,NULL,'GENERAL'),(212,'','Please provide a breakdown of the capital items you will buy and/or use for the project.','','','Capital Usage','Capital items',2,NULL,7,91,NULL,'COST'),(213,'','<p>You may subcontract work if you don’t have the expertise in your consortium. You can also subcontract if it is cheaper than developing your skills in-house.</p>','\0','',NULL,NULL,1,NULL,7,92,NULL,'GENERAL'),(214,'','Please provide details of any work that you expect to subcontract for your project.','','','Sub-contracting costs','Sub-contracts',2,NULL,7,92,NULL,'COST'),(215,'','<p>You should include travel and subsistence costs that relate only to this project. </p>','\0','',NULL,NULL,1,NULL,7,93,NULL,'GENERAL'),(216,'',NULL,'','','Travel and subsistence',NULL,2,NULL,7,93,NULL,'COST'),(217,'','<p>Please tell us if you have applied for or received any other public sector funding for this project. Any other funding received will need to be deducted from the total value of any funding you are claiming for this project.</p>','\0','',NULL,NULL,1,NULL,7,94,NULL,'GENERAL'),(218,'','Please note that legal or project audit and accountancy fees are not eligible and should not be included as an \'other cost’. Patent filing costs of New IP relating to the project are limited to £7,500 for SME applicants only.  Please provide estimates of other costs that do not fit within any other cost headings.','','','Other costs','Other costs',2,NULL,7,94,NULL,'COST'),(219,'',NULL,'\0','\0','FINANCE_SUMMARY_INDICATOR_STRING',NULL,17,NULL,7,95,NULL,'GENERAL'),(220,'\0','<h2 class=\"heading-medium\">Funding rules for this competition</h2><p>We will fund projects between &pound;500,000 and &pound;1.5 million. We may consider projects with costs outside of this range. We expect projects to last between 12 and 36 months.</p><p>Innovate UK\'s aim is to optimise the level of funding businesses receive. We also recognise the importance of research organisations\' contribution to R&amp;D projects. Therefore we require the following levels of participation:</p><ul class=\"list-bullet\"> <li>at least 70% of the total eligible project costs are incurred by commercial organisations and</li> <li>a maximum of 30% of total eligible project costs are available to research participants. Where there is more than one research participant, this maximum will be shared between them.</li></ul>','\0','\0',NULL,NULL,16,NULL,7,95,NULL,'GENERAL'),(221,'\0','<a target=\"_blank\" href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance/guidance-for-academics-applying-via-the-je-s-system\">How do I create my Je-S output?</a>','','','Upload a pdf copy of the Je-S output confirming a status of \'With Council\'','Je-s Output',20,NULL,6,70,NULL,'GENERAL'),(222,'\0','Enter the full title of the project','','\0','Application details','Application details',1,NULL,8,96,NULL,'GENERAL'),(225,'',NULL,'','\0','What is the business opportunity and potential market for your project?','Business opportunity and potential market',5,'1',8,97,10,'GENERAL'),(226,'','Explain how your project is innovative in both a commercial and technical sense.','','\0','What is innovative about your project?','Innovation',6,'2',8,97,10,'GENERAL'),(227,'','Describe your ability to develop and exploit this technology. Include details of your team\'s track record in managing research and development projects.','','\0','Who is in the project team and what are their roles?','Project team',7,'3',8,97,10,'GENERAL'),(228,'','Estimate the total costs of the project and tell us how much funding you need from Innovate UK and why.','','\0','How much will your project cost, and how does it represent value for money for your team and the 